import React from "react";
import "./Navbar.css";

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <a href="index.html">Home</a>
        </li>
        <li>
        <a href="index1.html" target="_blank">Invoice</a>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
